const clickNext = (length, stoppped, stores) => {
    var showIt = [];
    var i;
    if (length >= 3) {
        for (i = 0; i <3; i++) {
            showIt[i] = stores[length-i];
        }
    }
    else {
        for (i = 0; i <length; i++) {
            showIt[i] = stores[length-i];
        }
    }
    return showIt;
}
export default clickNext;
